import React, { useState } from 'react';
import {
    Button,
    Table,
    TableBody,
    TableCell,
    TableContainer,
    TableHead,
    TableRow,
    Paper,
    Accordion,
    AccordionSummary,
    AccordionDetails,
    Typography,
} from '@mui/material';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';

const PatientData = () => {
    const [patients, setPatients] = useState([]);

    const fetchData = async () => {
        try {
            const response = await fetch('https://localhost:7083/patients');
            const data = await response.json();
            setPatients(data);
        } catch (error) {
            console.error('Error fetching data:', error);
        }
    };

    return (
        <div>
            <Button variant="contained" color="primary" onClick={fetchData}>
                Fetch Patient Data
      </Button>

            <TableContainer component={Paper} style={{ marginTop: '20px' }}>
                <Table>
                    <TableHead>
                        <TableRow>
                            <TableCell>Patient First Name</TableCell>
                            <TableCell>Patient Last Name</TableCell>
                            {/* Add more table cells for other properties */}
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {patients.map((patient) => (
                            <React.Fragment key={patient.patientId}>
                                <TableRow>
                                    <TableCell colSpan={2}>
                                        <Accordion>
                                            <AccordionSummary expandIcon={<ExpandMoreIcon />}>
                                                <Typography>
                                                    First Name: {patient.firstName} - Last Name: {patient.lastName}
                                                </Typography>
                                            </AccordionSummary>
                                            <AccordionDetails>
                                                <Typography>
                                                    <pre>{JSON.stringify(patient, null, 2)}</pre>
                                                </Typography>
                                            </AccordionDetails>
                                        </Accordion>
                                    </TableCell>
                                </TableRow>
                            </React.Fragment>
                        ))}
                    </TableBody>
                </Table>
            </TableContainer>
        </div>
    );
};

export default PatientData;
